import React, {Component} from 'react'
import ReactDom from 'react-dom';
import NavButton from './NavButton.js';
import logo from '../logo.svg';
import { configure } from 'enzyme';
import TemplateMesero from './TemplateMesero.js';
import TemplateCocina from './TemplateCocina.js';
configure({ adapter: new Adapter() });

class Header extends Component {
    templateMesero (){
        ReactDom.render(<TemplateMesero/>, document.getElementById('containerBurger'))
    }
    templateCocina(){
        ReactDom.render(<TemplateCocina/>, document.getElementById('containerBurger'))
    }
render (){
    return (
    <div className="navHeader">   
        <nav className="navbar">
        <img src={logo}  width="100" height="100" className="d-inline-block align-top" alt=""/>
            <NavButton titulo="MESERO" customOnButtonClick={this.templateMesero}/>
            <NavButton titulo="COCINA" customOnButtonClick={this.templateCocina}/>
        </nav>
        <div id="containerBurger"></div>
    </div>
    )

}

}
  export default Header;
